    playbackData.comments = {"938aee4b-ac0f-4f40-af13-7e4e7bf10185":[{"id":"9ef6503c-4c86-4dae-a1ee-2fd6647bbbb8","displayCommentEventId":"938aee4b-ac0f-4f40-af13-7e4e7bf10185","displayCommentEventSequenceNumber":0,"developerGroupId":"0e0208e5-5b28-4ca0-b1ef-b43f1713d034","timestamp":1693499370599,"commentText":"In this example, we'll re-introduce some ideas that should be familiar from other programming languages such as Python, C++, or Java: values, identifiers, types, operators, and expressions. We'll talk about how variable declarations work in Haskell, and we'll introduce the <span style=\"font-family: Courier;\">String</span>, <span style=\"font-family: Courier;\">Integer</span>, and <span style=\"font-family: Courier;\">Double</span> types.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"587ec437-f3c2-4f3c-afbc-3bee34b3fa01":[{"id":"0e4fe2d7-5c58-470c-97f8-9b422173ff60","displayCommentEventId":"587ec437-f3c2-4f3c-afbc-3bee34b3fa01","displayCommentEventSequenceNumber":32,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693499622942,"commentText":"We'll start as usual with our default \"Hello, World!\" program. But wouldn't it be nice to generalize it?","commentTitle":"Starting out","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"2de548df-0a9f-40b9-9847-df58b7f086b8":[{"id":"4907ca4d-d052-4599-9e55-6a4e2cbb7428","displayCommentEventId":"2de548df-0a9f-40b9-9847-df58b7f086b8","displayCommentEventSequenceNumber":83,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693499705714,"commentText":"Let's declare a new variable, <span style=\"font-family: Courier;\">greeting</span>. This should look familiar.","commentTitle":"Variable declarations","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"d0889a2c-db93-41de-9be7-e8d3e8368a07":[{"id":"5f72c560-4750-4813-9f40-3aab4d496ee2","displayCommentEventId":"d0889a2c-db93-41de-9be7-e8d3e8368a07","displayCommentEventSequenceNumber":126,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693499910692,"commentText":"Let's generalize further by adding a separate <span style=\"font-family: Courier;\">name</span> variable. Whereas we initially defined&nbsp;<span style=\"font-family: Courier;\">greeting</span>&nbsp;with a <span style=\"font-style: italic;\">literal</span> value, now <span style=\"font-family: Courier;\">greeting</span> is defined as the value of an <span style=\"font-style: italic;\">expression</span>.&nbsp;<div><br></div><div>To concatenate the value of <span style=\"font-family: Courier;\">name</span> with two <span style=\"font-family: Courier;\">String</span> literals (<span style=\"font-family: Courier;\">\"Hello, \"</span> and <span style=\"font-family: Courier;\">\"!\"</span>), we use the <span style=\"font-family: Courier;\">String</span> concatenation operator <span style=\"font-family: Courier;\">&lt;&gt;</span>.</div><div><br></div><div>The values being operated on (<span style=\"font-family: Courier;\">name</span>,&nbsp;<span style=\"font-family: Courier;\">\"Hello, \"</span>&nbsp;and&nbsp;<span style=\"font-family: Courier;\">\"!\"</span>) are called <span style=\"font-style: italic;\">operands</span>, just like in math.</div>","commentTitle":"Literals, expressions, operators","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"1211deed-3877-4d25-98d2-56c5da48f3ca":[{"id":"a1f8263e-799a-4176-8ded-dbf49f52b2ee","displayCommentEventId":"1211deed-3877-4d25-98d2-56c5da48f3ca","displayCommentEventSequenceNumber":151,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693500165225,"commentText":"While Haskell can guess the types of variables for you (this feature is called <span style=\"font-style: italic;\">type inference)</span>, by convention we declare variable types explicitly. The line&nbsp;<div><br></div><div><span style=\"font-family: Courier;\">name, greeting :: String</span><br></div><div><br></div><div>is a <span style=\"font-style: italic;\">type declaration</span>. The variables <span style=\"font-family: Courier;\">name</span> and <span style=\"font-family: Courier;\">greeting</span> are declared to have type <span style=\"font-family: Courier;\">String</span>.</div><div><br></div><div>If you run this program on Replit, you can go to the console and type</div><div><br></div><div><span style=\"font-family: Courier;\">:t greeting</span></div><div><br></div><div>This will tell you the type of the <span style=\"font-family: Courier;\">greeting</span> variable. (You cannot use the <span style=\"font-family: Courier;\">:t</span> command in your programs - only in the console.)</div><div><br></div><div>If you go to the console and type just&nbsp;</div><div><br></div><div><span style=\"font-family: Courier;\">greeting</span></div><div><br></div><div>this will show you the value of the <span style=\"font-family: Courier;\">greeting</span> variable.</div>","commentTitle":"Type declarations","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"name, greeting :: String","startRow":2,"startColumn":0,"endRow":2,"endColumn":24}],"imageURLs":["media/images/1693501519799-Screen-Shot-2023-08-31-at-10.04.55-AM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"name, greeting :: String","commentTags":["image"],"questionCommentData":null}],"48ed7f49-1f11-41e5-b4a1-ab9b0a42e585":[{"id":"47c36e54-379c-402a-8da1-ecf042b22b0f","displayCommentEventId":"48ed7f49-1f11-41e5-b4a1-ab9b0a42e585","displayCommentEventSequenceNumber":191,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693500762705,"commentText":"Let's declare another variable, <span style=\"font-family: Courier;\">luckyNumber</span>, of type <span style=\"font-family: Courier;\">Integer</span>.<div><br></div><div>As in other languages, the name of a variable, function, etc., is called an <span style=\"font-style: italic;\">identifier. </span>According to the <a href=\"https://www.haskell.org/onlinereport/lexemes.html#:~:text=Identifiers%20and%20Operators\">Haskell 98 specification</a>, \"An identifier consists of a letter followed by zero or more letters, digits, underscores, and single quotes.\"</div><div><br></div><div>Variable names must begin with a lowercase letter. Soon we'll see the use of identifiers that start with uppercase letters. (Can you guess based on what you've seen so far?)</div>","commentTitle":"Identifiers","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"luckyNumber :: Integer\nluckyNumber = 7","startRow":6,"startColumn":0,"endRow":7,"endColumn":15}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"luckyNumber :: Integer\nluckyNumber = 7","commentTags":[],"questionCommentData":null}],"4620dcc5-1832-4387-9119-466f9728f692":[{"id":"5ee99cb4-9b58-4026-93fb-de8de1faa5f5","displayCommentEventId":"4620dcc5-1832-4387-9119-466f9728f692","displayCommentEventSequenceNumber":265,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693500891831,"commentText":"I want to show the lucky number along with the greeting. I don't like this code. There are two problems: (1) it has poor parallelism with the use of the previously defined greeting, and (2) when I run this code, I get an error.<div><br></div><div>Let's resolve the code structure issue, and then deal with the error.</div>","commentTitle":"Code organization","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"    putStrLn \"Your lucky number is \" <> luckyNumber <> \"!\"","startRow":2,"startColumn":0,"endRow":2,"endColumn":58}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"    putStrLn \"Your lucky number is \" <> luckyNumber <> \"!\"","commentTags":[],"questionCommentData":null}],"476b95f1-442e-499a-9973-b2705f5f35ca":[{"id":"fe2729a7-6577-45e9-93f6-9d29fcc32715","displayCommentEventId":"476b95f1-442e-499a-9973-b2705f5f35ca","displayCommentEventSequenceNumber":423,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693501330826,"commentText":"This looks better. Note that expressions can extend over multiple lines. We indent continued expressions for readability.<div><br></div><div>Now I'm getting an error. When you try to run this code on Replit, you should get a similar error:</div><div><br></div><div><div style=\"color: rgb(204, 204, 204); font-family: Menlo, Monaco, &quot;Courier New&quot;, monospace; font-size: 12px; white-space: pre;\">Couldn't match expected type ‘Integer’ with actual type ‘[Char]’</div></div><div><br></div><div>This tells us that we cannot concatenate an <span style=\"font-family: Courier;\">Integer</span> to a <span style=\"font-family: Courier;\">String</span>. (Note that <span style=\"font-family: Courier;\">[char]</span> is a synonym for <span style=\"font-family: Courier;\">String</span>; we'll learn how this works later in the semester.)&nbsp;</div><div><br></div><div>Unlike Python, Haskell does not have <span style=\"font-style: italic;\">type coercion</span>, a programming language feature where operands are automatically <span style=\"font-style: italic;\">cast</span>&nbsp;to an appropriate type for the operators.&nbsp;</div><div><br></div><div>We must call a <span style=\"font-style: italic;\">function</span> that takes an <span style=\"font-family: Courier;\">Integer</span> value, like <span style=\"font-family: Courier;\">luckyNumber</span>, and returns a <span style=\"font-family: Courier;\">String</span>. We call this a <span style=\"font-style: italic;\">type conversion.</span></div>","commentTitle":"Type errors, type conversion","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"greeting = \"Hello, \" <> name <> \"!\\n\" <>\n            \"Your lucky number is \" <> luckyNumber <> \"!\"","startRow":5,"startColumn":0,"endRow":6,"endColumn":57}],"imageURLs":["media/images/1693501586334-Screen-Shot-2023-08-31-at-10.06.07-AM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"greeting = \"Hello, \" <> name <> \"!\\n\" <>\n            \"Your lucky number is \" <> luckyNumber <> \"!\"","commentTags":["image"],"questionCommentData":null}],"38aa893a-09b4-42c1-9ee1-b8566c77add7":[{"id":"2b87f4b0-1639-4376-b653-772a6d62f990","displayCommentEventId":"38aa893a-09b4-42c1-9ee1-b8566c77add7","displayCommentEventSequenceNumber":463,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693502265946,"commentText":"Let's try assigning a new value to <span style=\"font-family: Courier;\">luckyNumber</span> using a more complicated expression.&nbsp;<div><br></div><div>When we try this, we get an error message:</div><div><br></div><div><span style=\"font-family: Courier;\">Multiple declarations of ‘luckyNumber’<br></span></div><div><br></div><div>As Joachim Breitner writes, \"<a href=\"https://haskell-via-sokoban.nomeata.de/#:~:text=variables%20are%20not%20mutable\">In Haskell, variables are not mutable boxes; they are just names for values!</a>\"</div><div><br></div><div>There is no <span style=\"font-style: italic;\">variable assignment</span>&nbsp;in Haskell; there are only&nbsp;<span style=\"font-style: italic;\">declarations</span>. Each variable can be declared only once, and henceforth it is <span style=\"font-style: italic;\">immutable</span>.</div><div><br></div><div>Let's fix this by ensuring <span style=\"font-family: Courier;\">luckyNumber</span> is declared exactly once.</div><div><br></div>","commentTitle":"Not assignment but declaration","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"luckyNumber = 10 - 3","startRow":10,"startColumn":0,"endRow":10,"endColumn":20}],"imageURLs":["media/images/1693502325202-Screen-Shot-2023-08-31-at-10.18.30-AM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"luckyNumber = 10 - 3","commentTags":["image"],"questionCommentData":null}],"c313b374-4979-4f99-a909-51728ba1d259":[{"id":"e1ccdc55-747f-4091-af97-cfb168237a2c","displayCommentEventId":"c313b374-4979-4f99-a909-51728ba1d259","displayCommentEventSequenceNumber":471,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693502599253,"commentText":"Ordinarily I would just edit the declaration of <span style=\"font-family: Courier;\">luckyNumber</span>. But here I want to show you a lot of different operators we can use with numbers, so I'll just comment out our original declaration using&nbsp;<div><br></div><div><span style=\"font-family: Courier;\">--&nbsp;</span><div><br></div><div>at the beginning of the line.</div></div><div><br></div><div>When we run this code, we see that <span style=\"font-family: Courier;\">luckyNumber</span>&nbsp;is defined as 9 instead of 7! In Haskell, expressions are typically evaluated from left to right. How do you think we can change the expression so that it has the value 7?</div>","commentTitle":"Comments, order of evaluation","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"--luckyNumber = 7\nluckyNumber = 10 - 2 + 1","startRow":9,"startColumn":0,"endRow":10,"endColumn":24}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"--luckyNumber = 7\nluckyNumber = 10 - 2 + 1","commentTags":[],"questionCommentData":null}],"c4455a3d-3cc2-455f-9f18-dfab10e2197f":[{"id":"ff3972cd-b39a-4921-82da-5c3793d603bd","displayCommentEventId":"c4455a3d-3cc2-455f-9f18-dfab10e2197f","displayCommentEventSequenceNumber":428,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693503023874,"commentText":"The built-in&nbsp;<span style=\"font-family: Courier;\">show</span> function converts almost any value into a <span style=\"font-family: Courier;\">String</span>.&nbsp;<div><br></div><div>Notice that functions have types, just like variables do. If you go to the Replit console and type</div><div><br></div><div><span style=\"font-family: Courier;\">:t show</span></div><div><br></div><div>you will see&nbsp;</div><div><br></div><div><span style=\"font-family: Courier;\">show :: Show a =&gt; a -&gt; String<br></span></div><div><br></div><div>This means that <span style=\"font-family: Courier;\">show</span> is a function that takes a single value of any \"showable\" type and returns a <span style=\"font-family: Courier;\">String</span>.&nbsp;</div><div><br></div><div>Ordinary data types are showable, but functions are not. If you type just</div><div><br></div><div><span style=\"font-family: Courier;\">show</span></div><div><br></div><div>in the console you will get a helpful error message asking, \"Did you really mean to do that?\"</div><div><br></div><div>We'll learn more about function types as you learn to declare your own functions.&nbsp;</div>","commentTitle":"The show function","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"show luckyNumber","startRow":6,"startColumn":39,"endRow":6,"endColumn":55}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"            \"Your lucky number is \" <> show luckyNumber <> \"!\"","commentTags":[],"questionCommentData":null}],"edef5a4d-0e09-4e79-8bb5-d0e84fab5737":[{"id":"07cff83b-959e-44b6-b90c-020932e5a7ef","displayCommentEventId":"edef5a4d-0e09-4e79-8bb5-d0e84fab5737","displayCommentEventSequenceNumber":473,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693503244855,"commentText":"Of course, we use parentheses!<div><br></div><div>You have probably already figured out that parentheses are not required to call a function in Haskell. We use parentheses only when necessary to specify the order of evaluation.</div>","commentTitle":"Parentheses","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"luckyNumber = 10 - (2 + 1)","startRow":10,"startColumn":0,"endRow":10,"endColumn":26}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"luckyNumber = 10 - (2 + 1)","commentTags":[],"questionCommentData":null}],"1c740bbe-4a65-485c-ab85-c74d7bcd296b":[{"id":"b0216221-e18d-495f-8ffa-65a4a580505f","displayCommentEventId":"1c740bbe-4a65-485c-ab85-c74d7bcd296b","displayCommentEventSequenceNumber":501,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693503364548,"commentText":"One of these situations where we need to use parentheses is when an expression involves a negative number. If we do not use parentheses, we will get a <i>parsing error</i>. Try it yourself and see!<div><br></div><div>While we are talking about negative numbers, you should also know about the <span style=\"font-family: Courier;\">abs</span> function, which computes the absolute value of any number. Here is the type signature of the <span style=\"font-family: Courier;\">abs</span> function:</div><div><br></div><div><div>abs :: Num a =&gt; a -&gt; a</div></div><div><br></div><div>The <span style=\"font-style: italic;\">type variable</span> <span style=\"font-family: Courier;\">a</span> stands for any numeric type. The function <span style=\"font-family: Courier;\">abs</span> takes a value that has a numeric type and returns a value of the same type. We will see some other numeric types besides <span style=\"font-family: Courier;\">Integer</span> very soon.</div>","commentTitle":"Negative numbers","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"luckyNumber = 10 + (-3)","startRow":11,"startColumn":0,"endRow":11,"endColumn":23}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"luckyNumber = 10 + (-3)","commentTags":[],"questionCommentData":null}],"78bbceee-d992-49f3-88ae-1fee0a073c34":[{"id":"c67a51da-fe8d-4562-aa6d-eb0632f1b34e","displayCommentEventId":"78bbceee-d992-49f3-88ae-1fee0a073c34","displayCommentEventSequenceNumber":524,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693503813079,"commentText":"We use the <span style=\"font-family: Courier;\">^</span> operator for exponentiation.&nbsp;<div><br></div><div>Note that the <span style=\"font-family: Courier;\">Integer</span> type is <i>unbounded</i>, meaning we can assign arbitrarily large values to a variable of type <span style=\"font-family: Courier;\">Integer</span>. If the value is larger than the native <span style=\"font-family: Courier;\">int</span> type, the Haskell runtime will allocate additional memory to hold the larger value.</div><div><br></div><div>Note that Haskell also has a bounded integer type, <span style=\"font-family: Courier;\">Int</span>, which can be useful if you need to process large amounts of integer data efficiently. But, like most Haskell programmers, we will use the <span style=\"font-family: Courier;\">Integer</span> type for its generality.</div>","commentTitle":"Exponentiation; integers are unbounded","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"luckyNumber = 2^1000","startRow":12,"startColumn":0,"endRow":12,"endColumn":20}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"luckyNumber = 2^1000","commentTags":[],"questionCommentData":null}],"c035e246-398e-4732-8896-6bc146d16417":[{"id":"4f2de8ee-d16e-4f49-b54d-0ecf00a0bc4c","displayCommentEventId":"c035e246-398e-4732-8896-6bc146d16417","displayCommentEventSequenceNumber":547,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693504191260,"commentText":"What do you think will happen if we try to run our program with this declaration?","commentTitle":"Numbers with a fractional part","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"luckyNumber = 7.05","startRow":13,"startColumn":0,"endRow":13,"endColumn":18}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"luckyNumber = 7.05","commentTags":[],"questionCommentData":null}],"5bad81a2-39fe-4357-b181-04332935e4dd":[{"id":"d25af779-0917-4924-bcad-e749bb82c1be","displayCommentEventId":"5bad81a2-39fe-4357-b181-04332935e4dd","displayCommentEventSequenceNumber":562,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693504329339,"commentText":"That's right, we will get a type error. We need to use function that converts the number to an <span style=\"font-family: Courier;\">Integer</span>.<div><br></div><div>One such function is <span style=\"font-family: Courier;\">truncate</span>. We also have <span style=\"font-family: Courier;\">floor</span>, <span style=\"font-family: Courier;\">ceiling</span>, and <span style=\"font-family: Courier;\">round</span>. These functions follow their usual mathematical definitions, which we will review in a mathematical setting next week.</div>","commentTitle":"Converting to Integer","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"3e701e19-3394-4c18-ae67-4984007c5bf1":[{"id":"14103c87-c05b-43fb-aaf8-88db01dac9e4","displayCommentEventId":"3e701e19-3394-4c18-ae67-4984007c5bf1","displayCommentEventSequenceNumber":619,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693504502613,"commentText":"We can use the ordinary division operator <span style=\"font-family: Courier;\">/</span> for real numbers, like so.","commentTitle":"Division, part 1","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"luckyNumber = floor (15.0/2.0)","startRow":14,"startColumn":0,"endRow":14,"endColumn":30}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"luckyNumber = floor (15.0/2.0)","commentTags":[],"questionCommentData":null}],"f396a01a-be67-4b97-92e6-ae4831765103":[{"id":"408b6755-e3bf-4849-90b6-79a3633dcdf1","displayCommentEventId":"f396a01a-be67-4b97-92e6-ae4831765103","displayCommentEventSequenceNumber":633,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693504601026,"commentText":"Haha, I didn't expect this to work but it did. We can use the division operator <span style=\"font-family: Courier;\">/</span> for integers too.","commentTitle":"Division, part 2","position":0,"selectedCodeBlocks":[{"fileId":"caef981e-5e7e-47e1-8824-d9d472a874c3","selectedText":"luckyNumber = floor (15 / 2.0)","startRow":14,"startColumn":0,"endRow":14,"endColumn":30}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"luckyNumber = floor (15 / 2.0)","commentTags":[],"questionCommentData":null}],"d52590a9-fad1-4604-93be-e5766ee0efe2":[{"id":"64efb25c-1d43-4fa6-aeb8-4f0a6f942e2c","displayCommentEventId":"d52590a9-fad1-4604-93be-e5766ee0efe2","displayCommentEventSequenceNumber":662,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693504677260,"commentText":"We can also use the <span style=\"font-family: Courier;\">div</span> function for integer division, discarding the remainder.","commentTitle":"Division, part 3","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"0c74c524-5b37-437b-93b2-df5e4a2bdf8f":[{"id":"e879c54f-500c-44f5-87cf-8daf6d12ac1d","displayCommentEventId":"0c74c524-5b37-437b-93b2-df5e4a2bdf8f","displayCommentEventSequenceNumber":705,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693504916889,"commentText":"And we can use the <span style=\"font-family: Courier;\">mod</span> function to compute the modulus.&nbsp;<div><br></div><div>Like Python, Haskell provides a <span style=\"font-family: Courier;\">rem</span> (remainder) function as well as the <span style=\"font-family: Courier;\">mod</span> (modulo) function. As in Python, the functions behave the same on positive parameters, but <a href=\"https://stackoverflow.com/questions/5891140/difference-between-mod-and-rem-in-haskell\">differently when given negative parameters</a>.</div>","commentTitle":"Division, part 4","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"32091994-0064-4927-bc8f-1c6903d20404":[{"id":"c8063a27-673d-4f07-925f-2a9c08f232a9","displayCommentEventId":"32091994-0064-4927-bc8f-1c6903d20404","displayCommentEventSequenceNumber":730,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693505141467,"commentText":"Since this is a discrete math class, we won't often work with real values in our programs. However, sometimes they are useful. Can we declare a variable of type <span style=\"font-family: Courier;\">Real</span>, similar to type <span style=\"font-family: Courier;\">Integer</span>?<div><br></div><div>It turns out we can't. We get an error:<br><br><div><span style=\"font-family: Courier;\">Expecting one more argument to ‘Real’</span></div><div><span style=\"font-family: Courier;\">Expected a type, but ‘Real’ has kind ‘* -&gt; Constraint’</span></div></div><div><br></div><div>We'll learn more about type constraints later. In the meantime, let's try a different type.</div>","commentTitle":"Can we declare a variable of type Real?","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"75ee0915-daab-469a-8856-739bb2c96939":[{"id":"604731d0-8885-415c-8f56-4971630a0cd8","displayCommentEventId":"75ee0915-daab-469a-8856-739bb2c96939","displayCommentEventSequenceNumber":750,"developerGroupId":"320e4f14-54b2-415e-8238-4b1d3f2cb7d0","timestamp":1693505426645,"commentText":"We can declare a variable as either a <span style=\"font-family: Courier;\">Float</span> or a <span style=\"font-family: Courier;\">Double</span>. As in other programming languages, these types are allocated a limited amount of memory, and their values have limited precision.<div><br></div><div>By the way, <span style=\"font-family: Courier;\">Float</span> and <span style=\"font-family: Courier;\">Double</span> both belong to the <span style=\"font-family: Courier;\">Real</span> <span style=\"font-style: italic;\">typeclass</span>. They also belong to the <span style=\"font-family: Courier;\">Num</span> typeclass. In mathematical terms, we can think of <span style=\"font-family: Courier;\">Double</span> as a subset of <span style=\"font-family: Courier;\">Real</span> and <span style=\"font-family: Courier;\">Real</span> as a subset of <span style=\"font-family: Courier;\">Num</span>. We'll learn more about typeclasses later in the semester.</div>","commentTitle":"Float and Double types","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null}]};
